import Header from "./Components/Header"
import Landing from "./Components/Landing"
import About from "./Components/About"
import Experience from "./Components/Experience"
import Projects from "./Components/Projects"

function App() {
  return (
    <div className="App">
      <main>
        <Header/>
        <Landing/>
        <About/>
        <Projects/>
        <Experience/>
      </main>
    </div>
  );
}

export default App;
